extern "C" void DisableInterrupts(void);
extern "C" void EnableInterrupts(void);


void Sound_Play(const uint8_t *pt, uint32_t count){
// write this
	uint16_t i = 0;
	uint32_t j;
	while(count > 0){
		DAC_Out(pt[i]);
		for(j = 0; j < 5000; j++){}
		count--;
		i++;
	}
	
};

void Sound_Next(void){
	DisableInterrupts();
	Sound_Play(powerup, 5000);
	EnableInterrupts();
}

void Sound_End(void){
	DisableInterrupts();
	Sound_Play(LaserShot, 5000);
	EnableInterrupts();
}

void Sound_Shoot(void){
	DisableInterrupts();
	Sound_Play(death, 5000);
	EnableInterrupts();
};
void Sound_Killed(void){
// write this
	DisableInterrupts();
	Sound_Play(start, 10000);
	EnableInterrupts();
};

